* денежные знаки, а также ценные бумаги (акции, облигации и т. п.) и платёжные документы (чеки, векселя, аккредитивы, девизы и т. п.), но только иностранного государства (понятие, эквивалентное термину «валютные ценности»); 
* не только денежные знаки, но и средства на банковских счетах и в банковских вкладах, то есть и наличные, и банковские (безналичные) деньги (денежный агрегат M1, M2 или даже M3); 
* любые ценности (не ограничиваясь валютными: ценными бумагами, платёжными документами, драгоценными металлами, камнями и т. д.), способные выполнять функции денег (понятие, эквивалентное термину «деньги»); в некоторых случаях сюда однако не включаются средства на банковских счетах и в банковских вкладах, то есть банковские (безналичные) деньги. Второе, исторически связанное и часто отдельно не выделяемое значение термина «валюта» — денежная единица, то есть единица измерения денег, используемая для выражения цен товаров и услуг, для установления номиналов денежных знаков, для определения стоимости (курса) иностранных валют. Так, например, денежной единицей Российской Федерации является российский рубль, состоящий из 100 копеек (последние выступают по отношению к национальной валюте разменными, или дробными денежными единицами). Денежными знаками, являющимися единственным законным средством платежа на территории Российской Федерации, являются номинированные в российских рублях и копейках билеты и монеты Банка России. Таким образом, национальной валютой России в значении «денежная единица» является российский рубль, а в значении «денежные знаки» — билеты и монеты Банка России.

Au sens strict, une devise est une unité monétaire acceptée par un pays étranger, tandis que la « monnaie » est celle de son pays. Elle est émise le plus souvent sous le contrôle d’une banque centrale (mais peut aussi être émise à partir d’un fond de panier collectif en multiples devises, géré par une organisation internationale adossée à plusieurs banques centrales indépendantes où ces fonds sont garantis par le dépôt de réserves). Chaque pays a une monnaie officielle sur son territoire déclinée en moyens de paiement ayant cours légal. Cependant plusieurs pays peuvent : 
* utiliser la même monnaie (cas de l’euro avec les pays membres de l’Union monétaire européenne, ou encore du Liechtenstein en union monétaire avec la Suisse — avec le franc suisse) ; 
* adopter une devise étrangère comme unité monétaire légale : cas de Panama et de l'Équateur (avec le dollar américain), ou encore du Vatican, de Saint-Marin, de Monaco et d'Andorre, et de facto du Kosovo et du Monténégro (avec l'euro). Pour des raisons pratiques, une devise a souvent des subdivisions, légales ou traditionnelles : 1/1000 (les millimes du dinar tunisien), 1/100 (les eurocents de l’euro), 1/20, 1/10, 1/8, 1/4 (le quarter américain)…
